  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_keys` (`imei`,`user_name`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=115 DEFAULT CHARSET=utf8 COMMENT='设备表';

