/*Table structure for table `message` */

DROP TABLE IF EXISTS `message`;

CREATE TABLE `message` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '消息ID',
  `uid` bigint(12) DEFAULT NULL COMMENT 'UID',
  `sender_id` bigint(12) DEFAULT NULL COMMENT '发送者UID',
  `msg_type` smallint(3) unsigned DEFAULT '0' COMMENT '消息类型(0:文本消息, 1:图片,2:音频, 3:视频,4:位置)',
  `content` varchar(255) DEFAULT NULL COMMENT '消息内容',
  `stat` smallint(2) unsigned DEFAULT '0' COMMENT '消息状态(0: 未读, 1: 已读)',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_keys` (`uid`,`sender_id`,`content`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='信息表';

/*Data for the table `message` */

/*Table structure for table `privilege` */

DROP TABLE IF EXISTS `privilege`;

CREATE TABLE `privilege` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '权限ID',
  `account_id` int(10) unsigned NOT NULL COMMENT '账户ID',
  `type` smallint(5) DEFAULT NULL COMMENT '权限类型(0:组，1:设备，2：用户)',
  `privilege` smallint(5) DEFAULT NULL COMMENT '(0: 无权限, 1:只读, 2:读写)',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_keys` (`account_id`,`type`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='权限表';

/*Data for the table `privilege` */

/*Table structure for table `sessions` */

DROP TABLE IF EXISTS `sessions`;

CREATE TABLE `sessions` (
  `session_id` varchar(255) NOT NULL,
  `TTL` varchar(255) DEFAULT NULL,
  `login_name` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`session_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `sessions` */

/*Table structure for table `user` */

DROP TABLE IF EXISTS `user`;

CREATE TABLE `user` (
  `id` bigint(12) unsigned NOT NULL AUTO_INCREMENT COMMENT '用户ID',
  `name` varchar(128) DEFAULT NULL COMMENT '用户名',
  `nick_name` varchar(128) DEFAULT NULL COMMENT '昵称',
  `passwd` varchar(255) DEFAULT NULL COMMENT '密码',
  `imei` varchar(255) DEFAULT NULL COMMENT 'IMEI（非普通用户的imei号是1，普通用户的imei号是15位）',
  `user_type` smallint(3) DEFAULT NULL COMMENT '用户类型(暂定1是普通用户，2是调度员，3是经销商, 4是超级管理员)',
  `pid` bigint(12) NOT NULL DEFAULT '0' COMMENT '父ID（非普通用户拥有父id，普通用户只有被管理者的id，就是cid）',
  `cid` bigint(12) NOT NULL COMMENT '该普通用户属于哪一个客户表中的客户所管理 如果是非普通用户就是默认为0（因为customer表里面没有0号）',
  `last_login_time` timestamp NULL DEFAULT NULL COMMENT '最近登录',
