/*Table structure for table `user_group` */

DROP TABLE IF EXISTS `user_group`;

CREATE TABLE `user_group` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '组ID',
  `group_name` varchar(255) NOT NULL COMMENT '组名',
  `account_id` int(10) DEFAULT NULL COMMENT '组调度员ID',
  `user_type` smallint(2) unsigned DEFAULT '0' COMMENT '创建者类型(0: 普通用户, 1: 管理账户)',
  `stat` smallint(255) DEFAULT '1' COMMENT '有效状态(0:无效，1:有效)',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `icon` varchar(255) DEFAULT NULL COMMENT '组头像',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=156 DEFAULT CHARSET=utf8 COMMENT='组';

